const Home = () => {
  // 사용자 로그인 여부
  const { isLoggedIn } = useSelector((state) => state.user);
  const { mainPosts } = useSelector((state) => state.post);
  // = const mainPOsts = userSelector((state) => state.post.mainPosts);
  return (
    <>
      <AppLayout>
        <PostForm />
        <PostCard />
      </AppLayout>
    </>
  );
};

export default Home;
